CREATE DATABASE IF NOT EXISTS OCTSOC;
USE OCTSOC;

-- Store Table
DROP TABLE IF EXISTS STORE;
CREATE TABLE STORE (
  store_number INT PRIMARY KEY,
  city VARCHAR(50) NOT NULL,
  state CHAR(2) NOT NULL,
  zip_code VARCHAR(10) NOT NULL,
  street VARCHAR(50) NOT NULL
);

-- Department Table
DROP TABLE IF EXISTS DEPARTMENT;
CREATE TABLE DEPARTMENT (
  department_number INT NOT NULL,
  name VARCHAR(100) NOT NULL,
  store_number INT NOT NULL,
  manager_id INT,
  CONSTRAINT department_key PRIMARY KEY (department_number, store_number),
  FOREIGN KEY (store_number) REFERENCES store(store_number),
  FOREIGN KEY (manager_id) REFERENCES employee(employee_id)
);

-- Employee Table
DROP TABLE IF EXISTS EMPLOYEE;
CREATE TABLE EMPLOYEE (
  employee_id INT PRIMARY KEY,
  first_name VARCHAR(50) NOT NULL,
  middle_initial CHAR(1),
  last_name VARCHAR(50) NOT NULL,
  department_number INT NOT NULL,
  FOREIGN KEY (department_number) REFERENCES department(department_number)
);

-- Supplier Table
DROP TABLE IF EXISTS SUPPLIER;
CREATE TABLE SUPPLIER (
  supplier_id INT PRIMARY KEY,
  name VARCHAR(100) NOT NULL,
  phone_number VARCHAR(20),
  contact_info VARCHAR(100)
);

-- Product Table
DROP TABLE IF EXISTS PRODUCT;
CREATE TABLE PRODUCT (
  product_id INT PRIMARY KEY,
  name VARCHAR(100) NOT NULL,
  msrp DECIMAL(10,2),
  sell_by_date DATE,
  supplier_id INT NOT NULL,
  department_number INT NOT NULL,
  FOREIGN KEY (supplier_id) REFERENCES supplier(supplier_id),
  FOREIGN KEY (department_number) REFERENCES department(department_number)
);

-- Customer Table
DROP TABLE IF EXISTS CUSTOMER;
CREATE TABLE CUSTOMER (
  membership_id INT PRIMARY KEY,
  first_name VARCHAR(50) NOT NULL,
  middle_initial CHAR(1),
  last_name VARCHAR(50) NOT NULL,
  membership_type VARCHAR(20),
  city VARCHAR(50),
  state CHAR(2),
  zip_code INT,
  street VARCHAR(20),
  email VARCHAR(100),
  phone_number VARCHAR(20),
  account_manager VARCHAR(100),
  shared_cardholder VARCHAR(100)
);

-- Inventory Table
DROP TABLE IF EXISTS INVENTORY;
CREATE TABLE INVENTORY (
  inventory_id INT PRIMARY KEY,
  product_id INT,
  quantity INT,
  store_number INT,
  FOREIGN KEY (product_id) REFERENCES product(product_id),
  FOREIGN KEY (store_number) REFERENCES store(store_number)
);

-- Sales Transaction Table
DROP TABLE IF EXISTS SALES_TRANSACTION;
CREATE TABLE SALES_TRANSACTION (
  transaction_id INT PRIMARY KEY,
  membership_id INT,
  employee_id INT,
  date DATE,
  time TIME,
  total_price DECIMAL(20,2),
  FOREIGN KEY (membership_id) REFERENCES customer(membership_id),
  FOREIGN KEY (employee_id) REFERENCES employee(employee_id)
);

-- Sales Transaction Details Table
DROP TABLE IF EXISTS SALES_TRANSACTION_DETAILS;
CREATE TABLE SALES_TRANSACTION_DETAILS (
  sales_transaction_detail_id INT PRIMARY KEY,
  transaction_id INT,
  product_id INT,
  quantity INT,
  subtotal DECIMAL(10,2),
  FOREIGN KEY (transaction_id) REFERENCES sales_transaction(transaction_id),
  FOREIGN KEY (product_id) REFERENCES product(product_id)
);

-- Shipment Table
DROP TABLE IF EXISTS SHIPMENT;
CREATE TABLE SHIPMENT (
  shipment_id INT PRIMARY KEY,
  store_destination INT,
  arrival_date DATE,
  supplier_id INT,
  FOREIGN KEY (store_destination) REFERENCES store(store_number),
  FOREIGN KEY (supplier_id) REFERENCES supplier(supplier_id)
);

-- Shipment Details Table
DROP TABLE IF EXISTS SHIPMENT_DETAILS;
CREATE TABLE SHIPMENT_DETAILS (
  shipment_details_id INT PRIMARY KEY,
  shipment_id INT,
  product_id INT,
  quantity INT,
  FOREIGN KEY (shipment_id) REFERENCES shipment(shipment_id),
  FOREIGN KEY (product_id) REFERENCES product(product_id)
);

